Kaos (Wesley Snipes) is een vervloekte scherpschutter. Hij heeft ieder gevecht kunnen winnen en al zijn tegenstanders kunnen doden. Door zijn vloek keren zijn slachtoffers echter allemaal terug uit de dood. Om de weer levend geworden zombies te bestrijden huurt hij een jonge vechter in die hem moet helpen.



